CREATE OR REPLACE FUNCTION updategeographicarea()
  RETURNS void AS
$BODY$DECLARE
    uniongeo varchar;
   	context record;
    u_id bigint;
    r_id bigint;
BEGIN
	
	select ST_Union(ga.geometry) into uniongeo from signalement.geographic_area ga WHERE id != 44;
	RAISE NOTICE 'geom: %', uniongeo;
	EXECUTE 'update signalement.geographic_area set geometry = ''' || uniongeo || ''' where id = 44';

	select item.id into r_id from signalement.role item WHERE name = 'Validator';
	select item.id into u_id from signalement.user_ item WHERE login = 't.brule';

	FOR context in select cd.* from signalement.context_description cd
	LOOP
		RAISE NOTICE 'values : % % %', context.id, r_id, u_id;
		execute 'insert into signalement.user_role_context (context_description_id, geographic_area_id, role_id, user_id) values ('
			|| context.id || ', 44, ' || r_id || ', ' || u_id || ')';
		
	END LOOP;	
	
	RETURN;
END$BODY$
  LANGUAGE plpgsql ;

select updategeographicarea();

